function abc(a, b) {
	$('#special__btn').click();
	var productsNum = b;
	$
			.ajax({

				method : 'get',
				url : 'productDetail',
				dataType : 'json',
				data : 'productsNum=' + productsNum,
				success : function(resq) {

					var resullt = '';

					resullt += '<div id="Product__board">'
					resullt += '<div id="Product__board1">';
					resullt += '<img style="border-radius: 20px;" src="resources/img/products/'
							+ resq[0].productsPicture
							+ '"  height="200px" width="200px%"><br />';
					resullt += '</div>';
					resullt += '<div id="Product__board2">';
					resullt += '名前(Name) : ';
					resullt += '<button class="productNameImformation" value="'
							+ resq[0].productsNameJap
							+ '" data-currentProdcut="'
							+ resq[0].productsNameJap + '">'
							+ resq[0].productsNameJap + '</button><br>';
					resullt += '地域(Location) : '
					resullt += resq[0].productsLocation + '<br>';
					resullt += '特徴(Feature) : '
					resullt += resq[0].productsFeatureJap + '<br>';
					resullt += '</div></div>';

					$('#production').html(resullt);
					$('.productNameImformation').click(link);
				}
			});
	return false;
};

function link() {
	$('#special__btn').click();
	$('#page2').get(0).click();
	var searchWord = $(this).attr('data-currentProdcut');
	$.ajax({
		method : 'GET',
		url : 'receiptBoard',
		data : {
			"searchWord" : searchWord
		},
		success : productRecipe
	});
}
function productRecipe(List) {
	
	var search2 = '';
	var currentPage2 = parseInt(List.currentPage);
	var currentPage3 = parseInt(List.navi.currentPage);
	var pagePerGroup2 = parseInt(List.navi.pagePerGroup);
	var currentPageGrNext2 = currentPage3 + pagePerGroup2;
	var currentPageGrBack2 = currentPage3 - pagePerGroup2;
	var startPageGroup2 = parseInt(List.navi.startPageGroup);
	var endPageGroup2 = parseInt(List.navi.endPageGroup);
	var number2 = '';
	var productsBts = '';
	var dataProductsdetail = '';

	/* select 문 */
	dataProducts = '<tr>'
	dataProducts += '<th>番号</th>'
	dataProducts += '<th>タイトル</th>'
	dataProducts += '<th>分類</th>'
	dataProducts += '</tr>'

	/* 검색 란 */
	search2 += '<div class="d5">'
	search2 += '<select name="productItem" id="productItem">'
	search2 += '<option value="material">材料</option>'
	search2 += '<option value="title">タイトル</option>'
	search2 += '<option value="recipe">分類</option>'
	search2 += '</select>'
	search2 += '<input type="text" name="productWord" value="'
			+ List.searchWord + '" id="productWord" />'
	search2 += '<button value="검색" id="searchProduct" class="searchProduct btn_change" />'
	search2 += '</div>'

	/* 상단 게시판 , 아랫단 게시판 반복문 */
	for (var i = 0; i < List.list.length; i++) {
		var boardNum = List.list[i].boardNum;
		var category = List.list[i].category;
		var title = List.list[i].title;
		var material = List.list[i].material;
		var amount = List.list[i].amount;
		var recipe = List.list[i].recipe;
		var imglink = List.list[i].imglink;
		var tips = List.list[i].tips;
		var productsBts = '';
		/*--------------------재료,수량,레시피정보 공백기준으로 split 작업---------------------- */
		var imfor3='';
		var reallyRecipe3='';
		var material13 = material.split(" ");
		
		var amount13 = amount.split(" ");
		
		var recipe13 = recipe.split(" ");
		
		for(var j=0;j<material13.length-1;j++){
			imfor3+= '<'+material13[j]+" : "+amount13[j]+'> ';
		}
		
		for(var k=0;k<recipe13.length-1;k++){
			reallyRecipe3+=(k+1)+'. '+recipe13[k]+'<br>';
		}
		/*------------------------------------------------------------------------- */

		if (currentPage3 != 1) {
			var boardNumFact = currentPage3 * 10 - 10 + (i * 1 + 1);
		} else {
			var boardNumFact = (i * 1 + 1);
		}

		/* 아랫단 전체 레시피 불러오기 */
		dataProductsdetail += '<div class="recipe__board__table">';
		dataProductsdetail += '<div id="Product__board1">';
		dataProductsdetail += '<img class="img__size" src="' + imglink
				+ '"/><br>';
		dataProductsdetail += '</div>';
		dataProductsdetail += '<div id="Product__board2">';
		dataProductsdetail += 'タイトル <div class = "title" value ="' + i + 1 + '">'
				+ title + '</div><br>';
		dataProductsdetail += '<div class = "category" value ="' + category
				+ '">' + category + '</div><br>';
		dataProductsdetail += '材料 数量 <div class = "material" value ="' + imfor3
				+ '">' + imfor3 + '</div><br>';
		dataProductsdetail += ' レシピ <br><div class = "recipe" value ="'
				+ reallyRecipe3 + '">' + reallyRecipe3 + '</div><br>';
		dataProductsdetail += 'チップ <div class = "tips" value ="' + tips + '">'
				+ tips + '</div><br>';
		dataProductsdetail += '<input type="button" class = "wishlist" value="mylist" data-boardNum="'+boardNum+'"/>'
		dataProductsdetail += '<input type="button" class = "wishlistpage" value="マイリストページへ移動" data-boardNum="'
			+ boardNum + '"/><br>'
		dataProductsdetail += '</div>';
		dataProductsdetail += '</div>';

		/* 상단 레시피 불러오기 */
		dataProducts += '<tr>'
		dataProducts += '<td><input readonly class = "boardNum" value ="'
				+ boardNumFact + '"/></td>'
		dataProducts += '<td><input class="productDetail" type="button" data-Num="'
				+ boardNum + '" value ="' + title + '"/></td>'
		dataProducts += '<td><input readonly class = "category" value ="'
				+ category + '"/></td>'
		dataProducts += '</tr>'
	}
	/* 패이지 처리 */
	for (var page = startPageGroup2; page <= endPageGroup2; page++) {

		if (page == currentPage3) {

			number2 += '<input type="button" class="currentPageNum2 btn__page" data-currentPage="'
					+ page
					+ '" data-searchItem="'
					+ List.searchItem
					+ '" data-searchWord="'
					+ List.searchWord
					+ '" style="color:red" value="' + page + '"/>'
		}
		if (page != currentPage3) {

			number2 += '<input type="button" class="justPageNum2 btn__page" data-currentPage="'
					+ page
					+ '" data-searchItem="'
					+ List.searchItem
					+ '" data-searchWord="'
					+ List.searchWord
					+ '" value="'
					+ page + '"/>'
		}

	}

	/* 패이지 버튼 처리 */
	productsBts += '<div class="boardfooter">'
	productsBts += '<input type="button" value="◁◁" class="ppBack btn__page" data-currentPage="'
			+ currentPageGrBack2
			+ '" data-searchItem="'
			+ List.searchItem
			+ '" data-searchWord="' + List.searchWord + '"/>'
	productsBts += '<input type="button" value="◀" class="pBack btn__page" data-currentPage="'
			+ currentPage3
			+ '" data-searchItem="'
			+ List.searchItem
			+ '" data-searchWord="' + List.searchWord + '"/>'
	productsBts += number2
	productsBts += '<input type="button" value="▶" class="pNext btn__page" data-currentPage="'
			+ currentPage3
			+ '" data-searchItem="'
			+ List.searchItem
			+ '" data-searchWord="' + List.searchWord + '"/>'
	productsBts += '<input type="button" value="▷▷" class="ppNext btn__page" data-currentPage="'
			+ currentPageGrNext2
			+ '" data-searchItem="'
			+ List.searchItem
			+ '" data-searchWord="' + List.searchWord + '"/>'
	productsBts += '</div>'

	$('#searchproducts').html(search2);/* 검색창을 searchproducts에 뿌리기 */
	$('#productResult').html(dataProducts);/* 상단 게시판 정보 productResult에 뿌리기 */
	$('#pageProductsBtn').html(productsBts);/* 페이지 버튼 정보 pageProductsBtn에 뿌리기 */
	$('#recipeDetail').html(dataProductsdetail);/* 처음 전체 레시피 정보 recipeDetail 뿌리기 */
	$('#recipeDetailBtn').html(productsBts);/*
											 * 처음 전체 레시피 버튼 정보 recipeDetailBtn
											 * 뿌리기
											 */
	$('input:button.productDetail').click(ProductRecipeDetails);
	$('#searchProduct').click(searchProductInformation);
	$('input:button.pNext').click(next3);
	$('input:button.pBack').click(back3);
	$('input:button.ppNext').click(GrNext3);
	$('input:button.ppBack').click(GrBack3);
	$('input:button.searchProduct').click(searchProductInformation);
	$('input:button.justPageNum2').click(pageChange3);
	$('input:button.wishlist').on('click', wishlist);
	$('input:button.wishlistpage').on('click', wishlistpage);
}
function next3() {
	var currentPage = $(this).attr('data-currentPage');
	var searchItem = $(this).attr('data-searchItem');
	var searchWord = $(this).attr('data-searchWord');

	var currentPagePlus = parseInt(currentPage) + 1;

	$.ajax({
		method : 'get',
		url : 'receiptBoard',
		data : {
			"currentPage" : currentPagePlus,
			"searchItem" : searchItem,
			"searchWord" : searchWord
		},
		success : recipeInformation
	});
}
